import React, { useEffect, useState } from "react";

const API = "http://localhost:5000";

export default function App() {
  const [page, setPage] = useState("jeux");
  const [list, setList] = useState([]);
  const [search, setSearch] = useState("");
  const [status, setStatus] = useState("OFFLINE");

  // üîÑ statut serveur en temps r√©el
  useEffect(() => {
    const ping = () => {
      fetch(`${API}/api/status`)
        .then((r) => r.json())
        .then((j) => setStatus(j.status))
        .catch(() => setStatus("OFFLINE"));
    };
    ping();
    const i = setInterval(ping, 2000);
    return () => clearInterval(i);
  }, []);

  // üì¶ charger jeux / logiciels
  useEffect(() => {
    fetch(`${API}/api/${page}`)
      .then((r) => r.json())
      .then(setList);
  }, [page]);

  const download = (name) => {
    window.location.href = `${API}/download/${page}/${encodeURIComponent(
      name
    )}.zip`;
  };

  const filtered = list.filter((n) =>
    n.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div style={styles.app}>
      {/* HEADER */}
      <header style={styles.header}>
        <div style={styles.logo}>üéÆ DOWNLOADER</div>

        <div style={styles.nav}>
          <button
            style={styles.navBtn(page === "jeux")}
            onClick={() => setPage("jeux")}
          >
            Jeux
          </button>
          <button
            style={styles.navBtn(page === "logiciels")}
            onClick={() => setPage("logiciels")}
          >
            Logiciels
          </button>
        </div>

        <div style={styles.status(status === "ONLINE")}>
          ‚óè {status}
        </div>
      </header>

      {/* SEARCH */}
      <div style={styles.searchBox}>
        <input
          value={search}
          onChange={(e) => setSearch(e.target.value)}
          placeholder={`Rechercher un ${page}...`}
          style={styles.searchInput}
        />
      </div>

      {/* GRID */}
      <div style={styles.grid}>
        {filtered.map((name) => (
          <div key={name} style={styles.card}>
            <img
              src={`${API}/images/${page}/${encodeURIComponent(name)}`}
              alt={name}
              style={styles.cardImg}
              onError={(e) => {
                e.target.src =
                  "https://picsum.photos/400/200?random=" +
                  Math.floor(Math.random() * 1000);
              }}
            />

            <div style={styles.cardBody}>
              <div style={styles.title}>{name}</div>
              <button
                style={styles.downloadBtn}
                onClick={() => download(name)}
              >
                T√©l√©charger
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

const styles = {
  app: {
    minHeight: "100vh",
    background: "radial-gradient(circle at top, #0f2027, #000)",
    color: "#fff",
    fontFamily: "Segoe UI, sans-serif",
  },

  header: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "20px 40px",
    borderBottom: "1px solid rgba(255,255,255,0.1)",
  },

  logo: {
    fontSize: 26,
    fontWeight: "bold",
    color: "#00f6ff",
    textShadow: "0 0 15px #00f6ff",
  },

  nav: {
    display: "flex",
    gap: 15,
  },

  navBtn: (active) => ({
    padding: "10px 20px",
    borderRadius: 20,
    cursor: "pointer",
    background: active ? "#00f6ff" : "transparent",
    color: active ? "#000" : "#fff",
    border: "1px solid rgba(255,255,255,0.2)",
    transition: "0.3s",
  }),

  status: (online) => ({
    fontWeight: "bold",
    color: online ? "#00ff9c" : "#ff4d4d",
    textShadow: online ? "0 0 10px #00ff9c" : "0 0 10px #ff4d4d",
  }),

  searchBox: {
    padding: 30,
    display: "flex",
    justifyContent: "center",
  },

  searchInput: {
    width: "60%",
    padding: 15,
    borderRadius: 30,
    border: "none",
    outline: "none",
    fontSize: 16,
    background: "rgba(255,255,255,0.08)",
    color: "#fff",
    boxShadow: "0 0 15px rgba(0,255,255,0.2)",
  },

  grid: {
    display: "grid",
    gridTemplateColumns: "repeat(auto-fill, minmax(260px, 1fr))",
    gap: 30,
    padding: 40,
  },

  card: {
    background: "rgba(255,255,255,0.06)",
    borderRadius: 20,
    overflow: "hidden",
    boxShadow: "0 0 25px rgba(0,255,255,0.15)",
    transition: "0.3s",
    backdropFilter: "blur(10px)",
  },

  cardImg: {
    width: "100%",
    height: 170,
    objectFit: "cover",
  },

  cardBody: {
    padding: 15,
  },

  title: {
    fontSize: 16,
    marginBottom: 12,
  },

  downloadBtn: {
    width: "100%",
    padding: 12,
    borderRadius: 20,
    background: "#00f6ff",
    color: "#000",
    border: "none",
    cursor: "pointer",
    fontWeight: "bold",
    transition: "0.3s",
  },
};
